When things start to fall in line for him with   Tammana, a child comes to him claiming Karthi     (Rocket Raja) to be his father. After a series    of comical events thief Karthi finds out the      child is the daughter of the Police man Karthi    and tries to send her back to him. But            unfortunately he becomes the witness to the       murder of the other Karthi by villains. He is     then forced to play the part of the dead Police   officer to hunt down the villains and keep the    child safe.      

